import { Navbar, Form, Nav, FormControl, Button, Container } from 'react-bootstrap';
const { Component } = require("react");



class NavBarCustom extends Component {
    constructor(){
        super();
    }

    render(){
        return(
            <Navbar bg="dark" variant="dark" className="navbar" expand="lg">
                <Container>
                    <Navbar.Brand href="/">Twatter</Navbar.Brand>
                    <Nav className="mr-auto navbar-nav">
                        <Nav.Link href="/" className="nav-link">Home</Nav.Link>
                        <Nav.Link href="/profile" className="nav-link">Profile</Nav.Link>
                        <Nav.Link href="/settings" className="nav-link">Settings</Nav.Link>
                    </Nav>
                    <Form inline className="Buttons">
                        <Button variant="outline-info">Login</Button>
                        <Button variant="outline-info">Register</Button>
                        <Button variant="outline-warning">New Post</Button>
                    </Form>
                </Container>
            </Navbar>
        )
    }
}

export default NavBarCustom;
